import React from 'react';
import {Route} from 'react-router-dom';
import {useAuth} from "./context/auth";

function PrivateRoute({component: Component, ...rest}) {
    const isAuthentiated = useAuth();
    return (
        <Route 
            {...rest} 
            render={(props) => 
            isAuthentiated ? (
                <Component {...props} />
            ) : (
            <Redirect to="/"/>
        )}
        />
    )
}
export default PrivateRoute;
